import React, { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <div>
        <h1>Hello!</h1>
        <p>My name is Johnny!</p>
        <p>I love life!</p>
        <div>
          <p>My favorite language is JavaScript</p>
          <p>I love React!</p>
        </div>
      </div>
    )
  } 
};

export default App;
